import BookTicketComponent from "./BookTicket.component";
class BookTicket extends Component {
  constructor(props) {
    super(props);
    this.state = {
      //currentMovieDetails: props.currentMovieDetails
    };
    console.log("from Booking");
    console.log(props);
  }
  componentDidMount() {
    console.log("booking: componentDidMount");
  }

  bookTicketClickHandler() {
    console.log("im clicked to book final tickets");
  }
  singleSeatClickHandler() {}

  render() {
    return (
      <BookTicketComponent
        selectedEventDetails={this.props.selectedEventDetails}
        totalRows={this.props.selectedEventDetails.hall.total_rows}
        totalRows={this.props.selectedEventDetails.hall.total_columns}
        showDate={props.selectedEventDetails.show_date}
        showTime={props.selectedEventDetails.show_time}
        bookTicketClickHandler={bookTicketClickHandler}
        singleSeatClickHandler={singleSeatClickHandler}
      />
    );
  }
}
BookTicket.defaultProps = {};
export default BookTicket;
